/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `set_nroNC` BEFORE INSERT ON `notascredito` FOR EACH ROW BEGIN
    DECLARE last_nroNC INT;
    
    -- Obtener el último nroNC registrado
    SELECT MAX(CAST(nroNC AS UNSIGNED)) INTO last_nroNC FROM notasCredito;
    
    -- Si es el primer registro, setear nroNC en 00001
    IF last_nroNC IS NULL THEN
        SET NEW.nroNC = '00001';
    ELSE
        -- Incrementar el último nroNC por 1
        SET NEW.nroNC = LPAD(last_nroNC + 1, 5, '0');
    END IF;
END */;;
